import React from "react";
import Adimage from "../images/Untitled.svg";

class ADPage extends React.Component {

    render(){
        return (
            <img
            style={{ width: "100vw", height: "150px" }}
            src={Adimage}
            alt="로고"/>
        );
    }
}
export default {ADPage}
